import React, { Component } from "react";
import { Col, Container, Row } from "react-bootstrap";

class Nav extends Component {
  render() {
    return (
      <nav>
          <Row className="top">
            <Container>
            <Col>
              <p className="label-dark">Top Nav.</p>
            </Col>
            </Container>
          </Row>
          <Row className="bottom">
          <Container>
            <Col>
              <p className="label-light">Bottom Nav.</p>
            </Col>
            </Container>
          </Row>
      </nav>
    );
  }
}

export default Nav;
